CREATE TABLE users
    -- List of system users
(
  user_id int,
  username varchar(50),
  password varchar(50),
  is_admin bool
);



CREATE TABLE orders
    -- the test unused data
(
  order_id int,
  user_id int,
  `date` date,
  value float,
  paid bool
);

CREATE TABLE real_orders
    -- The list of user orders
(
  order_id int,
  user_id int,
  `date` date,
  value float,
  payment_system varchar(10),
  paid bool
);

SELECT order_id, user_id, `date`, value, 'paypal', false
FROM orders;

